webpackJsonp([0x5ea2692dc9ee],{1284:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/pok%C3%A9project-dev-diary-day-four-25aed272eb17/index.md absPath of file >>> MarkdownRemark",html:'<h1>PokéProject Dev Diary: Day Four</h1>\n<h2>Adverts, and going live.</h2>\n<p>At this point, we’ve <a href="https://medium.com/@psyked/pok%C3%A9project-dev-diary-day-one-8a77a252bf0a">prototyped our idea</a>, <a href="https://medium.com/@psyked/pokeproject-dev-diary-day-two-a6019e6cf0f0">improved it visually</a>, <a href="https://medium.com/@psyked/pok%C3%A9project-dev-diary-day-three-31afdf3e1302">sorted out our own store of data</a>, and now it’s time to — finally — go live.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*ar_BjfWyVqeI7iWpilFueQ-2025d8aeee8abe8b240b17776fd1cfd6-f513e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 431px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 ar BjfWyVqeI7iWpilFueQ"\n        title=""\n        src="/static/1*ar_BjfWyVqeI7iWpilFueQ-2025d8aeee8abe8b240b17776fd1cfd6-f513e.png"\n        srcset="/static/1*ar_BjfWyVqeI7iWpilFueQ-2025d8aeee8abe8b240b17776fd1cfd6-47b38.png 158w,\n/static/1*ar_BjfWyVqeI7iWpilFueQ-2025d8aeee8abe8b240b17776fd1cfd6-1ab5f.png 315w,\n/static/1*ar_BjfWyVqeI7iWpilFueQ-2025d8aeee8abe8b240b17776fd1cfd6-f513e.png 431w"\n        sizes="(max-width: 431px) 100vw, 431px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>version 1.0 is now live!</p>\n<p>In the spirit of <a href="https://en.wikipedia.org/wiki/Agile_software_development">Agile</a>, I’m not going to wait for every one of my crazy ideas to be finished before opening it up to the whole world — we’re going to go live with an <a href="https://en.wikipedia.org/wiki/Minimum_viable_product">MVP</a> and soft launch our way to world domination.</p>\n<p>In a fit of impulsiveness (and on the wrong side of midnight) I’ve decided to stick with the working project name and purchase it as a domain name: <a href="https://www.pokeproject.co.uk">pokeproject.co.uk</a>, so now we’ve even got a real domain, and we can stop redirecting our beta testers to a subdomain.</p>\n<h4>Advertising</h4>\n<p>One of my sly objectives with this project was to also try out advertising, using a service like <a href="https://www.google.com/adsense/start/">Google Adsense</a> to make some money out of it all. I’ve never added adverts to any of my side projects before — hating adverts as much as the next internet user — but this time I’ll selectively ignore my own disapproval of advertising to give some money-making opportunity a shot, even if it is to see for myself just how fantastically unprofitable it really is!</p>\n<p>I’ve made a little space down the bottom of the screen for adverts to appear, signed up to Google Adsense, created a few tags and dropped them into the design. We’ll see how well that goes as time progresses.</p>\n<hr>\n<p>PokéProject is now live @ <a href="https://www.pokeproject.co.uk">https://www.pokeproject.co.uk</a></p>',frontmatter:{title:"PokéProject Dev Diary: Day Four",date:"September 19, 2016",tags:["Blogging","Advertising","Agile","Pokemon"],url:"https://medium.com/@psyked/pok%C3%A9project-dev-diary-day-four-25aed272eb17",image:"https://cdn-images-1.medium.com/max/1200/1*ar_BjfWyVqeI7iWpilFueQ.png",description:"Adverts, and going live."}}},pathContext:{prev:{frontmatter:{path:"/blog/pokeproject-dev-diary-day-four-25aed272eb17/",tags:null,title:"PokéProject Dev Diary: Day Four",image:"https://cdn-images-1.medium.com/max/1200/1*ar_BjfWyVqeI7iWpilFueQ.png",date:"2016-09-19T19:16:16.296Z"}},next:{frontmatter:{path:"/blog/pokeproject-dev-diary-day-five-92859457a20a/",tags:null,title:"PokéProject Dev Diary: Day Five",image:"https://cdn-images-1.medium.com/max/1200/1*Kp3dePIQiFvW6HuPg7Dxpg.jpeg",date:"2016-09-20T20:11:03.647Z"}}}}}});
